import React, { useEffect } from 'react';

export default function TestButton() {
    const writeJsonFile = require('write-json-file');
    const data = { "status": "A" }
    useEffect(() => {
        writeJsonFile('foo.json', data)
    })
    return (
        <div>
            <button onClick={useEffect()}>json</button>
        </div>
    )
}
